import React from "react"

export default function Login(){


    const OnSubmit = (event) => {

        event.preventDefault();


    }


    return(

        <form onSubmit={OnSubmit}>
        <input type='text' placeholder="username"> </input>
        <input type='password' placeholder="password"/>
        <button> Login </button>



    </form>
    )
}
